@BawdenSnoek @JCAPoquoson Agree Sharon it is but the fig tree prophecy states the final end in a generation.
A generation is a mans lifetime, Bible says this can be 70~80yrs, a fluid timeframe between these numbers.
Israel celebrated their jubilee yr April 2018, the final 7 has been in progress ever since

